import Promo from '../../components/Promo/Promo'
import AboutMe from '../../components/AboutMe/AboutMe';
import NavTab from '../../components/NavTab/NavTab';
import AboutProject from '../../components/AboutProject/AboutProject';

function Main() {
    return (
        <main className="main">
            <Promo />
            <NavTab />
            <AboutProject />
            <AboutMe />
        </main>
    )
}

export default Main;
